import Card from "../Card/Card";

const CardsCont = () => {

    const friends = [
        {
            name: "diego",
            belleza: "mucha",
            fortaleza: "demasiada",
            dimensiones: "exageradas"
        },
        {
            name: "claudio",
            belleza: "nada",
            fortaleza: "entrenando",
            dimensiones: "gordo"
        },
        {
            name: "alexa",
            belleza: "superior",
            fortaleza: "en cerebro",
            dimensiones: "gluteos"
        },{
            name: "mia khalifa",
            belleza: "morena",
            fortaleza: "actriz",
            dimensiones: "llamativas"
        },
        {
            name: "anastasia",
            belleza: "alguito",
            fortaleza: "alma",
            dimensiones: "tetero"
        },
        {
            name: "gabriela",
            belleza: "indigena",
            fortaleza: "dinero",
            dimensiones: "profesiones"
        }
    ]

    return (
        <div>
            { friends.map( frien => {
                return <Card
                name={frien.name}
                belleza={frien.belleza}
                fortaleza={frien.fortaleza}
                dimensiones={frien.dimensiones}
                />
            })}
        </div>
    )
}

export default CardsCont;
